import React from 'react'
const nl2br = require('react-nl2br');
const Tasklist = (props) => {
    //console.log(props.tasklist)
    return (
        <React.Fragment>
            {
                props.dateblock === props.tasklist.date ? props.userid === props.tasklist.user_id ?
                        <></> : "" : ""
            }
        </React.Fragment>
    )
}
export default Tasklist;
